import { BrowserRouter, Routes, Route } from 'react-router-dom';

const Main = () => {
    return (
        <div>
            <BrowserRouter>
                <Navbar/>
                <Body/>
                <Routes>
                    <Route path="/admin" element={<Inicio/>}></Route>
                </Routes>
            </BrowserRouter>
        </div>
    )
}

export default Main;
